import React from 'react';
import './App.css';
import { FaGithub, FaTwitter, FaReact } from "react-icons/fa";
import { Timeline, Follow } from 'react-twitter-widgets'
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing(2),
  },
  h2: {
    color: theme.palette.text.secondary,
  },
}));

function App() {
  const classes = useStyles();

  return (
    <div className="App">
      <Grid container spacing={3}>
        <Grid item xs={8}>
          <Paper className={classes.paper}>
          <h1>Tennis Tweets  <FaTwitter /> </h1> 

      <h2 className={classes.h2}> What is it? </h2>
      <p></p>
      <h2 className={classes.h2}>What was it built with?</h2>
      <p></p>
      <h2>Total Statistics</h2>
          </Paper>
        </Grid>
        <Grid item xs={4}>
          <Paper className={classes.paper}>
          <Timeline
        dataSource={{
          sourceType: 'profile',
          screenName: 'tennisscores2'
        }}
        options={{
          username: 'Tennis_Tweets',
          height: '550',
          width: '300'
        }}
        onLoad={() => console.log('Timeline is loaded!')}
      />
          </Paper>
        </Grid>
      </Grid>
    </div>
  );
}

export default App;
